import React, { Component } from 'react';
import './Calculator.css'

export class CalculatorComponent extends Component 
{
  render() 
  {
    return (
      <div className="calculatorComponent">
        <div class="container">
          <div class="row">
          <div class="col-2">
            <button type="button" className="btn btn-primary btn-lg calc-button">+1</button>
          </div>
          <div class="col-2">
            <button type="button" className="btn btn-primary btn-lg calc-button">+1</button>
          </div>
          <div class="col-8">
            <button type="button" className="btn btn-primary btn-lg calc-button">+1</button>
          </div>
          <button type="button" className="btn btn-primary btn-lg calc-button">+1</button>
          <button type="button" className="btn btn-primary btn-lg calc-button">+1</button>
          <span className="calc-total">0</span>
          </div>
        </div>
      </div>
    );
  }
}

export default CalculatorComponent;
